import { Footer } from "./Component/Layout/Footer";
import { Header } from "./Component/Layout/Header";
import { AppLayout } from "./Component/Layout/AppLayout";


const App = () => {
 
  return (
  <>
    <Footer/>
    <Header/>
    <AppLayout/>
  </>
  );
};

export default App;
